text = ""
def isUnit(string):
    if (string[0].islower() and string[1].isupper()):
        return string[0] == string[1].lower()
    elif (string[0].isupper() and string[1].islower()):
        return string[0] == string[1].upper()
    return False

def notFinished(text):
    for i in range(0, len(text)-1):
        if isUnit(text[i:i+2]):
            return True
    return False

maxreached = 0
count = 0
removed = ""
while notFinished(text):
    for i in range(maxreached, len(text)-1):
        if isUnit(text[i:i+2]):
            maxreached = i
            text = text[:i] + text[i+2:]
            break
    if not notFinished(text[maxreached:]):
        maxreached = 0
    count += 1
    print(count, len(text), maxreached)

print(len(text))